private fun caricaNelDb(db: FirebaseFirestore, via: Via) {
    val idAutogenerato = db.collection("vie").document().id
    via.id = idAutogenerato
    db.collection("vie")
        .document(idAutogenerato)
        .set(via, SetOptions.merge())
        .addOnCompleteListener{
            Log.e("firebase", "Via creata correttamente.")
        }
}